import { useHistory } from 'react-router';

export const Button = () => {
    const history = useHistory();
    const handleClick = () => {
        history.goBack();
    }
    return (
        <>
        <button type="submit" onClick = {handleClick}>
            Previous
        </button>
        <button type="submit">
            Next
        </button>
        </>       
    )
}
